let sort = true
function sortearquiz(){
    quest = document.getElementById("quest")
    quest.display = "flex"
    if(sort){
        perguntas = JSON.parse(localStorage.getItem('quest'))
        sort = false
    }
    if(perguntas.length > 0){
        quest = document.getElementById('quest')
        let e = Math.floor(Math.random()*perguntas.length)
        var pergunta = document.createElement("p")
        pergunta.className = "pergunta"
        pergunta.textContent = perguntas[e]
        q.push(perguntas[e])
        quest.appendChild(pergunta)
        //quest.innerHTML += `<p class="pergunta">${perguntas[e]}</p>`    
        perguntas.splice(e,1) 
        let pessoas = document.getElementById("pessoas")  
        px += 70 
        pessoas.style.top = `${px}px`
    }
}
var mudandodenome = 0
function mudarnome(q){
    var mudanome = document.getElementById("mudarnome")
    mudanome.style.display = "block"
    if(q == 0)
        mudandodenome = 0
    else
        mudandodenome = 1
}
function salvarnome(){
    var mudanome = document.getElementById("mudarnome")
    var novoNome = document.getElementById("novonome").value
    var nome = document.getElementsByClassName('nome')[mudandodenome]
    nome.textContent = novoNome
    mudanome.style.display = "none"
    Tdgrupos[mudandodenome].nome = novoNome
    localStorage.grupos = JSON.stringify(Tdgrupos)
}
function posicionargrupos(){
    var nome = document.getElementsByClassName('nome')[0]
    var nome2 = document.getElementsByClassName('nome')[1]
    if(localStorage.grupos)
        Tdgrupos = JSON.parse(localStorage.getItem("grupos"))
    nome.textContent = Tdgrupos[0].nome
    nome2.textContent = Tdgrupos[1].nome
}
function gerarpdf(){
     var Professor = ""
    var Licao = ""
    const data = new Date()
    const doc = new jsPDF()
    let dia = `Aula do dia ${data.getDate()}/${data.getMonth() + 1}/${data.getFullYear()}`
    if(data.getDate() == 16 || data.getDate() == 27){
        Professor = "João Wesley"
    } else if(data.getDate() == 13 || data.getDate() == 20 ){
        Professor = "Gabriel"
        if(data.getDate() == 13){
            Licao = "07 - A responsabilidade é pessoal \n08 - O bom pastor e os pastores infiéis"
        }
    }

    doc.setFontSize(18)
    doc.setFontType('bold')
    doc.text('Turma Força Jovem', 70, 10)

    doc.setFontSize(15)
    doc.setFontType('bold')
    doc.text(dia, 72,20)
    doc.text("Lição Ministrada:", 20, 33)
    doc.setFontType('normal')
    doc.text(Licao, 25, 40)
    doc.setFontType('bold')
    doc.text("Professor(a): " + Professor , 135,33)
    
    doc.setFontType('bold')
    doc.setFontSize(12)
    doc.text("Perguntas: ", 20, 58)
    doc.setFontType('normal')
    doc.text(JSON.parse(localStorage.getItem('quest')),25, 65)
    doc.setFontType('bold')
    doc.text("Grupos: ", 20, 110)
    
        var imgData = 'data:image/jpeg;base64,'
    doc.addImage(imgData, 'JPEG', 40, 115, 100, 45)
    doc.setFontType('normal')
    doc.setTextColor(250)
    doc.text(Tdgrupos[0].nome + "\n Pontos:" + Tdgrupos[0].pnts, 55, 135)
    doc.setTextColor(0)
    doc.text(Tdgrupos[1].nome + "\n Pontos:" + Tdgrupos[1].pnts, 110, 135)
    doc.text("Grupo vencedor do dia: ", 70,170)
    if(Tdgrupos[0].pnts == Tdgrupos[1].pnts)
        doc.text("Empate!", 70,175)
     else if(Tdgrupos[0].pnts > Tdgrupos[1].pnts)
        doc.text(Tdgrupos[0].nome, 70,175)
     else
        doc.text(Tdgrupos[1].nome, 70,175)
    doc.save("relatorioDia" + dia + ".pdf")
}


